import React from 'react'
import { TextField, Paper } from '@material-ui/core'

function StoryField() {
    return (
        <Paper style={{ textAlign: "center", marginTop: "1rem", width: "60" }}>
            <TextField label="Title" style={{ width: "52%" }}></TextField>
            <TextField multiline variant="outlined" style={{ width: "50%" }} rows="10"></TextField>
        </Paper>

    )
}

export default StoryField
